import './App.css';
import {
  BrowserRouter as Router,Routes,Route} from "react-router-dom";
import {MainPage} from './pages/MainPage'
import {FilmPage} from './pages/FilmPage'


function App() {
  return (
    <div className="App">
      <Router>        
       <MainPage/>  
         <Routes>
           <Route path='/' element={<MainPage/>}/>
           <Route path='film/:id' element={<FilmPage/>}/>
         </Routes>


       </Router>
    </div>
  );
}

export default App;
